import React, { Component } from 'react';

export class User extends Component {
  componentDidMount() {
    this.props.getUser(this.props.match.params.login);
  }

  render() {
    const {
      name,
      avatar_url,
      location,
      bio,
      blog,
      login,
      htlm_url,
      followers,
      following,
      public_repos
    } = this.props.User;

    return <div>User</div>;
  }
}

export default User;
